import React from 'react'
import axios from '../../axios/index'
import { Button, } from 'antd';
import { connect } from 'react-redux'

class Feedback extends React.Component {

  /*
  * 发送请求获取成绩数据*/
  request = () =>{
    axios.ajax({
      url: '',
      data: {
        studentID: '',
        studentPassword: '',
        //是否已上J类
        isAttendJLesson: '',
        //是否已上通核
        isAttendSLesson: '',
        //外语类总学分
        isAttendFLesson: '',
        //通识类总学分
        totalCreditOfGeneralCourse: '',
        //军体类总学分
        totalCreditOfPACourse: '',
        //自然科学类总学分
        totalCreditOfNSCourse: '',
        //专业必修课程
        totalCreditOfNCourse: '',
        //专业选修课程
        totalCreditOfCCourse: '',
      }
    })
  };

  render() {

    return(
        <div>
          <p>你的学号是{this.props.studentID}</p>
          <p>你的专业是{this.props.studentMajor}</p>
          <Button htmlType="button">生成报告</Button>
        </div>
    )
  }
}

const mapStateToProps = state =>{
  console.log(state);
  return{
    // studentID: state.studentID,
    // studentPassword: state.studentPassword,
    // studentMajor: state.studentMajor,
  }
};
export default connect(mapStateToProps)(Feedback);
